import React, { useState, useEffect } from 'react'
import NewButton from './NewButton';
import ShowsLink from './IdeaLink';
import MyContext from './MyContext';



const Ideas = () => {
    return (
        <MyContext.Consumer>
        {context => {
                const showsList = context.shows.map(s => <IdeaLink key={s.id} show={s} />)
                return(
                    <div>
                        <h3>My Ideas</h3> 
                        <hr/>
                        {showsList}
                        <br/>
                        <br/>
                        <NewButton />    
                    </div>
                )
            }
        }
        </MyContext.Consumer>
    )
}

export default Ideas
